script: |
  super -f tsv -I q9242.sql | sort > q9242.out

vector: true

inputs:
  - name: q9242.sql
    data: |
      SELECT DISTINCT * FROM tab1 AS cor0 WHERE - col0 NOT BETWEEN ( col2 * col1 ) AND col1 * - col0 * col0 OR col0 * col0 + col2 * + col0 IN ( + cor0.col0 );
  - name: tab1

outputs:
  - name: q9242.out
    data: |
      3	26	54
      64	10	57
      80	13	96
